<p>We are trying to use sysID to characterize our elevator this year. We are starting simple with a single motor and developed a basic class which is called as the autonomous command. I looked at the WPILib documentation and <span class="abbreviation">CTRE<template class="tooltiptext" data-text="Cross The Road Electronics"></template></span>’s pages on integration with SysId and I couldn’t find a comprehensive discussion of how logging is supposed to be done. I pretty much just copied what their code says, but in terms of getting the “position”, “velocity”, “acceleration” values to show up in the SignalLogger or whatever performs the log during a sysid test, I am unsure what to do. Here is our code.</p>
<pre><code class="lang-auto">package frc.robot;
import static edu.wpi.first.units.Units.Volts;
import java.util.function.Consumer;
import com.ctre.phoenix6.SignalLogger;
import com.ctre.phoenix6.controls.VoltageOut;
import com.ctre.phoenix6.hardware.TalonFX;
import edu.wpi.first.units.measure.AngularVelocity;
import edu.wpi.first.units.measure.Voltage;
import edu.wpi.first.wpilibj2.command.Command;
import edu.wpi.first.wpilibj2.command.SubsystemBase;
import edu.wpi.first.wpilibj2.command.sysid.SysIdRoutine;
public class motorSub extends SubsystemBase {
    private final TalonFX motor;
    private double voltage = 0.0;
    private final TalonFX m_motor = new TalonFX(2);
    private final VoltageOut m_voltReq = new VoltageOut(0.0);
    private final SysIdRoutine m_sysIdRoutine =
       new SysIdRoutine(
      new SysIdRoutine.Config(
         null,        // Use default ramp rate (1 V/s)
         Volts.of(4), // Reduce dynamic step voltage to 4 to prevent brownout
         null,        // Use default timeout (10 s)
                      // Log state with Phoenix SignalLogger class
         (state) -&gt; SignalLogger.writeString("state", state.toString())
      ),
      new SysIdRoutine.Mechanism(
         (volts) -&gt; m_motor.setControl(m_voltReq.withOutput(volts.in(Volts))),
         null,
         this
      )
   );
    public motorSub() {
        motor = new TalonFX(2);
        motor.setPosition(0);
    }
    public Command sysIdQuasistatic(SysIdRoutine.Direction direction) {
        return m_sysIdRoutine.quasistatic(direction);
     }
     public Command sysIdDynamic(SysIdRoutine.Direction direction) {
        return m_sysIdRoutine.dynamic(direction);
     }
}
</code></pre>
