<p>It tells us to open the <span class="abbreviation">CTRE<template class="tooltiptext" data-text="Cross The Road Electronics"></template></span> Phoenix Tuner X and look at logs, but when I do that, and open the log folder, nothing is shown.<br>
Instead, we used DataLogTool and downloaded the WPILIB robot log. When we open the log in SysID, there is no recorded values for “position”, “velocity”, “acceleration”. All we see is the “state” string, which generates empty drag-and-drop values.</p>
<p><img src="https://www.chiefdelphi.com/uploads/default/original/3X/f/1/f1a37995cce70072a9a82c73889cedbf1e62d4cf.jpeg" alt="{334D8EF3-4CF8-4451-B919-29F9A1EBCD0D}" data-base62-sha1="ytDjslznixVA6bQ0PSCY6bJEgZp" width="492" height="381"></p>
<p>(Example from WPILib documentation) - only the sysid test state shows up in our log.</p>
